import React, { Component, Children } from 'react';
import { array } from 'prop-types';
import { forEachChild } from 'typescript';
 
class FetchConnectApi extends Component {
  constructor(props) {
        super(props)
        this.state = {
            Listing: []
        }
    }   
    
    myfunction(){
        const jsonObj = this.state.Listing.children;
        
        const jsonObjArr = this.state.Listing.map(c => c.children);
        return jsonObjArr;
    }

    /* function execution occurs
     after async request completed */
 componentDidMount() {
  fetch('https://www.reddit.com/r/nonbinary.json')
 .then(Listing => { if (!Listing.ok)
  { throw Error("Network request failed") }
  return Listing;
 })
 .then(data => data.json())
 .then(data => this.setState({Listing: data})
 );

}


 render() {
 const yourMom = this.myfunction();

    if (this.state.requestFailed) return <p>Failed!</p>
    if (!this.state.results) return <div>{
        yourMom[0]}</div>
 }
}
 export default FetchConnectApi;
